from django.test import TestCase, RequestFactory
from unittest.mock import patch, MagicMock
from User.models import CustomUser
from django.contrib.auth import get_user_model
from .services import SpotifyClientService, SpotifyService

User = get_user_model()

class SpotifyTestCase(TestCase):
    def setUp(self):
        factory = RequestFactory()
        self.user:CustomUser = User.objects.create_user(
            user_login="testuser",
            password="testpassword",
            spotify_id="testspotifyid",
            access_token="testtoken",
        )

    @patch("SpotifyController.services.spotipy.Spotify")
    def test_get_top_tracks_called(self, mock_spotify):
        mock_spotify_instance = MagicMock()
        mock_spotify.return_value = mock_spotify_instance

        mock_spotify_instance.current_user_top_tracks.return_value = {
            "items": ["track1", "track2"]
        }

        service = SpotifyClientService(self.user.access_token)
        top_tracks = service.get_user_top_tracks()

        mock_spotify_instance.current_user_top_tracks.assert_called_once_with(
            limit=20, time_range="medium_term"
        )

        self.assertEqual(top_tracks["items"], ["track1", "track2"])

